import './App.css';
import Header from "./Header"
import AddContact from "./AddContact"
import ContactList from "./ContactList"

function App() {
  const contacts = [
    {
      id : "1",
      name : "Revanth",
      email: "rbalinen@buffalo.edu"
    },
    {
      id : "2",
      name : "Rushwant",
      email: "rushwant@gmu.edu"
    }
  ]
  return (
    <div className='ui container'>
      <Header/>
      <AddContact/>
      <ContactList/>
    </div>
  );
}

export default App;
